wait: 	
	difficult: bgt $s3, $zero, call
		   j call_end
	call:	jal run_gravity
		sub $s3, $s3, 1
		j difficult
	call_end:lw $s3, SPEED
		bnez $s0, next
		jal invoke_gravity
		jal invoke_gravity
		
	next:
		li $v0, 32
		li $a0, 70
		syscall
		li $t1, key
      		lw $t0, 0($t1)
      		move $a0, $t0
      		jal key_press
      		beq $s1, -1, wait
      		beq $s1, 1, wait
      		lw $a0, left_foot_add
      		lw $a1, right_foot_add
      		jal check_if_floating
      		beq $v0, 1, continue_floating
      		li $s0, 0
      		li $s1, -1
      		li $s2, 0
      		j wait
continue_floating: li $a0, 2
      		  jal run_check
      		beq $v0, 1, wait
      		li $a0, -0x200
      		jal move_naruto
      		j wait

j END

wait_p: 
	li $t1, key
	lw $t0, 4($t1)
	beq $t0, 0x70, key_p
	j wait_p


key_press:
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
	move $t0, $a0
	beqz $t0, return_key_early
	li $t1, key
	lw $t0, 4($t1)
	
	beq	$t0, 0x61, key_a					# ASCII code of 'a' is 0x61 or 97 in decimal
	beq	$t0, 0x77, key_w						# ASCII code of 'w' is 0x77
	beq	$t0, 0x64, key_d						# ASCII code of 'd' is 0x64
	beq	$t0, 0x70, key_p	

										# ASCII code of 'p' is 0x70

return_key_early:	
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra

key_a: 	
		lw $t4, top_left_char_nohit
		
		addi $t4, $t4, -4
		lw $t5, 0($t4)
		beq $t5, crimson_red, return_key_early
		
		li $a0, 0
		jal run_check
		beq $v0, 1, return_key_early
		
		li $a0, -0x4	#shift left
		jal move_naruto
		j return_key_early

	#draw background
	#draw_character
	#reset_character
	#draw_platform
	#draw_object
key_w:	
		
		bnez $s2, further_check
		li $a0, 2
		jal run_check
		beq $v0, 1, return_key_early
		lw $a0, left_foot_add
		lw $a1, right_foot_add
		jal check_if_floating
		beq $v0, 1, return_key_early
		
	
		
		
further_check:	
		blt $s2, 2, double_jump
		bnez $s0, go
		j wait
		
double_jump:	li $s0, BLOCKS_JUMP
		li $s1, 0
		addi $s2, $s2, 1
	
go:		li $a0, -0x200
		jal move_naruto
		j return_key_early

