check_if_floating:	#a0 = left foot, a1= right foot
			move $t0, $a0
			move $t1, $a1
			
			addi $t0, $t0, 0x200
			addi $t1, $t1, 0x200
			
			lw $t3, 0($t0)
			lw $t4, 0($t1)
			
			beq $t3, ocean_blue, return_not
			beq $t4, ocean_blue, return_not
			
			li $v0, 1
			jr $ra
			
	return_not:	li $v0, 0
