	  la $a1, shuriken_iteration4
	  li $a2, 7
	  li $a3, 1

	  jal draw_object
	  
	  	
	  lw $a1, 0($sp)	#important to save
 	  addi $sp, $sp, 4
	  blt $a1, 4, return_shuriken_early
	  addi $a0, $a0, -0x200
	  
