			 lw $ra, 0($sp)
 	  		 addi $sp, $sp, 4
 	  		 
	  		 jr $ra
	  
	  
reset_shuriken:

	#a0 will have bottom left address of shuriken
	#a1 will have shuriken iteration

	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
	addi $sp, $sp, -4
	sw $a0, 0($sp)		#saving just in case
	
	
	
	
