return_shuriken_early_r:	lw $a0, 0($sp)	#important to save
 	  	  		addi $sp, $sp, 4
 	  	  		lw $ra, 0($sp)	#important to save
 	          		addi $sp, $sp, 4
		  		jr $ra



run_gravity:
		addi $sp, $sp, -4
		sw $ra, 0($sp)
		
		la $t0, shurikens
		li $t1, 0
		li $t2, 1
		
	loop:	blt $t1, 9, continue
		j check_if_many
		
		
	continue:	
			lw $t4, 0($t0)	#shuriken addy
			lw $t8, 4($t4)
			bne $t8, -1, increment_with_grav
			j increment_without
	
	increment_with_grav: 	
			addi $t0, $t0, 4
			addi $t1, $t1, 1
			addi $t2, $t2, 1
	
			addi $sp, $sp, -4
			sw $t0, 0($sp)
			addi $sp, $sp, -4
			sw $t1, 0($sp)
			addi $sp, $sp, -4
			sw $t2, 0($sp)
			
			move $a0, $t4
			jal shuriken_gravity
			
			lw $t2, 0($sp)
			addi $sp, $sp, 4
			lw $t1, 0($sp)
			addi $sp, $sp, 4
			lw $t0, 0($sp)
			addi $sp, $sp, 4
			
			j loop
	increment_without: 	addi $t0, $t0, 4
				addi $t1, $t1, 1
				j loop
		
			
		
	check_if_many: bge $t2, $s4, done
		       jal restart_single_shuriken
		       move $a0, $v1
		       jal shuriken_gravity
	
	
	done:	lw $ra, 0($sp)
		addi $sp, $sp, 4
		jr $ra
 

shuriken_gravity:	#a0 = shuriken falling 
			addi $sp, $sp, -4
			sw $ra, 0($sp)
			
		


shuriken_grav_cont:	jal shuriken_down_movement
			beq $s7, 0, early_shur_grav
			beq $v1, ocean_blue, restart_shuriken
			beq $v1, ice_cream_color1, restart_shuriken
			beq $v1, ice_cream_color2, restart_shuriken
			beq $v1, scroll_color1, restart_shuriken
			beq $v1, scroll_color2, restart_shuriken
			beq $v1, scroll_color3, restart_shuriken
			beq $v1, ramen_color, restart_shuriken
			move $a1, $v1 
			jal check_shur_collision
			li $s7, 0
			j early_shur_grav	

restart_shuriken:
			jal reset_single_shuriken
			jal restart_single_shuriken
			li $s7, 0
			j early_shur_grav
			 	#temp stop	

early_shur_grav:	lw $ra, 0($sp)
			addi $sp, $sp, 4
			jr $ra


shuriken_down_movement:	#a0 = shurikenx address
			
	
		addi $sp, $sp, -4
		sw $ra, 0($sp)	
		addi $sp, $sp, -4	#save a0
		sw $a0, 0($sp)
	
		lw $t2, 0($a0)	
		lw $a1, 4($a0)
		move $a0, $t2	
		
		addi $t2, $t2, 0x200
		addi $sp, $sp, -4
		sw $t2, 0($sp)
		
		jal reset_shuriken
		
		

		lw $t2, 0($sp)
		addi $sp, $sp, 4
		
		lw $a0, 0($sp)
		addi $sp, $sp, 4
		
		sw $t2, 0($a0)
		lw $t3, 4($a0)
		addi $t3, $t3, 1
		sw $t3, 4($a0)
		
		addi $sp, $sp, -4	#save a0
		sw $a0, 0($sp)
		move $a0, $t2
		move $a1, $t3	
		jal draw_shuriken
		
		
		lw $a0, 0($sp)
		addi $sp, $sp, 4
		lw $ra, 0($sp)
		addi $sp, $sp, 4
		jr $ra


check_shur_collision:	#a1 is color it collided with
		addi $sp, $sp, -4
		sw $ra, 0($sp)
		addi $sp, $sp, -4
		sw $a0, 0($sp)
		
		beq $a1, blonde, hit
		beq $a1, black, hit
		beq $a1, orange, hit
		beq $a1, peach, hit
		beq $a1, dark_gray, hit
		lw $a0, 0($sp)
		addi $sp, $sp, 4
		lw $ra, 0($sp)
		addi $sp, $sp, 4
		
		jr $ra
		
	hit:	
		jal naruto_hit
		lw $a0, 0($sp)
		addi $sp, $sp, 4
		lw $ra, 0($sp)
		addi $sp, $sp, 4
		jr $ra
		
		


check_naruto_collision:	#a1 is color it collided with
		addi $sp, $sp, -4
		sw $ra, 0($sp)
		li $s7, 0	#reset very important
		beq $a1, ice_cream_color1, ice_hit
		beq $a1, ice_cream_color2, ice_hit
		beq $a1, scroll_color1, scroll_hit
		beq $a1, scroll_color2, scroll_hit
		beq $a1, scroll_color3, scroll_hit
		beq $a1, ramen_color, ramen_hit
		beq $a1, shuriken_red, shuriken_hit
		lw $ra, 0($sp)
		addi $sp, $sp, 4
		jr $ra

ice_hit:	#s3 stores speed, lower it
		addi $s3, $s3, -1
		sw $s3, SPEED
		lw $t4, ice_cream_addy
		move $a0, $t4
		la $a1, ice_cream
		li $a2, 5
		li $a3, 8
		jal reset_object
		j hit_return
		#clear ice_cream
		lw $ra, 0($sp)
		addi $sp, $sp, 4
		jr $ra

scroll_hit:	# $s6 stores number of scrolls
		addi $s6, $s6, 1
		beq $s6, 1, clear_first
		beq $s6, 2, clear_second
		beq $s6, 3, clear_third
		#clear scroll addy
hit_return:
		lw $ra, 0($sp)
		addi $sp, $sp, 4
		jr $ra

clear_first:	lw $t4, scroll_addy1
		move $a0, $t4
		la $a1, scroll
		li $a2, 11
		li $a3, 6
		jal reset_object
		
		lw $a0, top_left_char_add
		la $a1, naruto
		li $a2, 14
		li $a3, 14
		jal reset_object
		
		li $v0, 32
		li $a0, 200
		syscall
		li $a0, checkmark1
		la $a1, checkmark
		li $a2, 7
		li $a3, 6
		jal draw_object
		li $v0, 32
		li $a0, 200
		syscall
		lw $ra, 0($sp) 
		addi $sp, $sp, 4
		j level_2
clear_second:	jal clear_shurikens
		lw $t4, scroll_addy2
		move $a0, $t4
		la $a1, scroll
		li $a2, 11
		li $a3, 6
		jal reset_object
		lw $a0, top_left_char_add
		la $a1, naruto
		li $a2, 14
		li $a3, 14
		jal reset_object
		li $v0, 32
		li $a0, 200
		syscall
		li $a0, checkmark2
		la $a1, checkmark
		li $a2, 7
		li $a3, 6
		li $v0, 32
		li $a0, 200
		syscall
		lw $ra, 0($sp)
		addi $sp, $sp, 4
		j level_3

clear_third:	
		lw $t4, scroll_addy3
		move $a0, $t4
		la $a1, scroll
		li $a2, 11
		li $a3, 6
		jal reset_object
		
		lw $a0, top_left_char_add
		la $a1, naruto
		li $a2, 14
		li $a3, 14
		jal reset_object
		li $v0, 32
		li $a0, 200
		syscall
		li $a0, checkmark3
		la $a1, checkmark
		li $a2, 7
		li $a3, 6
		jal draw_object
		li $v0, 32
		li $a0, 200
		syscall
		jal clear_shurikens
		lw $ra, 0($sp)
		addi $sp, $sp, 4
		j game_win

ramen_hit:	#s5 restores health
		addi $s5, $s5, 1
		lw $t4, ramen_addy
		move $a0, $t4
		la $a1, ramen
		li $a2, 8
		li $a3, 5
		jal reset_object
		jal clear_shurikens
		jal draw_health
		jal generate_shuriken_addresses

		#clear ramen addy
		lw $ra, 0($sp)
		addi $sp, $sp, 4
		jr $ra
	

shuriken_hit: 	addi $s5, $s5, -1
		jal clear_shurikens
		jal draw_health	
		jal draw_health	
		jal generate_shuriken_addresses
			
		bne $s5, 0, hit_return
		lw $ra, 0($sp)
		addi $sp, $sp, 4
		j game_over

naruto_hit:	#OH NO NARUTO GOT HIT !!!	#a0 shuriken that hit him
		li $s7, 0	#reset first very important
		
		addi $sp, $sp, -4
		sw $ra, 0($sp)
		addi $sp, $sp, -4
		sw $a0, 0($sp)
		
	
		
		jal reset_single_shuriken
			
		
		jal naruto_pink
		
		li $v0, 32
		li $a0, 200
		syscall
		
			
		lw $a0, top_left_char_add
		la $a1, naruto
		li $a2, 14
		li $a3, 14
		jal reset_object
		
		
		
		lw $a0, top_left_char_add
		la $a1, naruto
		li $a2, 14
		li $a3, 14
		jal draw_object


		jal clear_shurikens
		
		sub $s5, $s5, 1
		jal draw_health
		beqz $s5, over_sequence
		jal generate_shuriken_addresses
		
		
				
		lw $a0, 0($sp)
		addi $sp, $sp, 4	
		lw $ra, 0($sp)
		addi $sp, $sp, 4 
		jr $ra	
		
over_sequence:	lw $a0, 0($sp)
		addi $sp, $sp, 4	
		lw $ra, 0($sp)
		addi $sp, $sp, 4 
		j game_over

clear_shurikens:	
			move $t1, $zero
			la $t3, shurikens	#load address of shurikens
			addi $sp, $sp, -4
			sw $ra, 0($sp)
			
	clearing:	blt $t1, 9, keep_clearing
			lw $ra, 0($sp)
			addi $sp, $sp, 4
			jr $ra
	
	keep_clearing:	
			lw $t4, 0($t3)	#gets address of shurikenx
			lw $t5, 4($t4)	#gets shuriken[1]
			beq $t5, -1, clear_early
			
			addi $sp, $sp, -4
			sw $t3, 0($sp)
			addi $sp, $sp, -4
			sw $t1, 0($sp)
			
			move $a0, $t4
			
			jal reset_single_shuriken
			
			
			lw $t1, 0($sp)
			addi $sp, $sp, 4
			lw $t3, 0($sp)
			addi $sp, $sp, 4
			
			
	
			
	clear_early:	addi $t3, $t3, 4	#increment array
			addi $t1, $t1, 1
			j clearing	#increment counter
			
			
		
generate_shuriken_addresses:	 #function called when collision and/or level start	
				addi $sp, $sp, -4
				sw $ra, 0($sp)
					#just in case
	
				move $t1, $zero	#load 0 to increment
						#invoke number generator 0-8 to pick wish shurikens
	keep_generating:	blt $t1, $s4, continue_generation
				lw $ra, 0($sp)
				addi $sp, $sp, 4
				
				jr $ra
				
	continue_generation:	addi $sp ,$sp, -4
				sw $t1, 0($sp)
				
				jal restart_single_shuriken
				
				lw $t1, 0($sp)
				addi $sp, $sp, 4
				
				addi $t1, $t1, 1
				j keep_generating



reset_single_shuriken:	#a0 shurikenx address
	
			addi $sp, $sp, -4
			sw $ra, 0($sp)
			
			addi $sp, $sp, -4
			sw $a0, 0($sp)	#just in case
			
			
			lw $a1, 4($a0)	#shurikenx[1]
			lw $a0, 0($a0)	#shuriken[1]
			
			
			jal reset_shuriken
			
			lw $a0, 0($sp)	#get it back
			addi $sp, $sp, 4
				
			lw $t8, 0($a0)	#get addy
			lw $t9, 8($a0)	
			sw $t9, 0($a0)	#reset
			li $t7, -1
			sw $t7, 4($a0)
			
			lw $ra, 0($sp)
			addi $sp, $sp, 4
			
			jr $ra

restart_single_shuriken:
				#$v1 has address of which shuriken generated
				addi $sp, $sp, -4
				sw $ra, 0($sp)
				
		
	random_shuriken:	li $v0, 42
				li $a0, 0
				li $a1, 7
				syscall
				move $t2, $a0
				addi $t2, $t2, 1
				j random_address
				
	random_address:		la $t3, shurikens
				sll $t2, $t2, 2
				add $t3, $t3, $t2						#address of shuriken
				lw $t8, 0($t3)
				move $v1, $t8		
				lw $t4, 4($t8)			#check if shurikenx[1] eq -1
				beq $t4, -1, continue_shur
				j random_shuriken
	
	continue_shur:		li $v0, 42
				li $a0, 0
				li $a1, 7
				syscall
				addi $a0, $a0, 2
				move $t0, $a0
				sll $t0, $t0, 2				#want to pick a num 2-11
				lw $t5, 8($t8)
				add $t5, $t5, $t0
				sw $t5, 0($t8)
				sw $zero, 4($t8)
				lw $ra, 0($sp)
				addi $sp, $sp, 4
				jr $ra
				

fill_array_horizontally: #parameters t4 = length, t5 = address, t6 = color (left right)

	lw $t4, 0($sp)
	addi $sp, $sp, 4
	lw $t5, 0($sp)
	addi $sp, $sp, 4
	lw $t6, 0($sp)
	addi $sp, $sp, 4
	
	while_fill_horizontally: bgt $t4, $zero, continue_horizontal
	       j end_fill_horizontally
	continue_horizontal:
		sw $t6, 0($t5)
		addi $t5, $t5, 4
		sub $t4, $t4, 1
		j while_fill_horizontally
	
	end_fill_horizontally: jr $ra

fill_array_vertically: 
	lw $t4, 0($sp)
	addi $sp, $sp, 4
	lw $t5, 0($sp)
	addi $sp, $sp, 4
	lw $t6, 0($sp)
	addi $sp, $sp, 4
	while_fill_vertically: bgt $t4, $zero, continue_vertical
		j end_fill_vertically
	continue_vertical:
		sw $t6, 0($t5)
		addi $t5, $t5, 0x200
		sub $t4, $t4, 1
		j while_fill_vertically
	
	end_fill_vertically: jr $ra

run_check:	#a0 is way of movement 0 = a, 1 = d, 2 = w
		#v0 = 1 able to move that way, v0 = 0 not able to move that way
		
		li $v0, 0
		lw $t0, top_left_char_nohit
		lw $t1 top_right_char_nohit
		li $t2, 0
		beq $a0, 0, check_left
		beq $a0, 1, check_right
		beq $a0, 2, check_top
		li $t9, black
	check_left:	blt $t2, 12, lefty
			jr $ra
		 lefty: 
		 	addi $t4, $t0, -0x4
		 	lw $t5, 0($t4)
		 	beq $t5, ocean_blue, return_true_early
		 	addi $t0, $t0, 0x200
		 	addi $t2, $t2, 1
			j check_left
	check_right:	blt $t2, 12, righty
			jr $ra
		 righty: 
		 	addi $t4, $t1, 0x4
		 	lw $t5, 0($t4)
		 	beq $t5, ocean_blue, return_true_early
		 
		 	addi $t1, $t1, 0x200
		 	addi $t2, $t2, 1
			j check_right
			
	check_top:	blt $t2, 12, top
			jr $ra
		 top: 
		 	addi $t4, $t0, -0x200
		 	lw $t5, 0($t4)
		 	beq $t5, ocean_blue, special_top_return
		 	addi $t0, $t0, 0x4
		 	addi $t2, $t2, 1
			j check_top
		
	
	special_top_return:	li $s0, 0
				li $s1, 1			
	return_true_early:	li $v0, 1
				jr $ra


draw_health:	addi $sp, $sp, -4
		sw $ra, 0($sp)
		
		
		 beq $s5, 4, draw_h4
		 beq $s5, 3, draw_h3
		 beq $s5, 2, draw_h2
		 beq $s5, 1, draw_h1
		 beq $s5, 0, lose

draw_h4:	li $a0, heart4
		la $a1, heart
		li $a2, 7
		li $a3, 6
		jal draw_object
		j end_heart
	
draw_h3:	li $a0, heart4
		la $a1, heart
		li $a2, 7
		li $a3, 6
		jal reset_special_objects
		li $a0, heart3
		la $a1, heart
		li $a2, 7
		li $a3, 6
		jal draw_object
		j end_heart

draw_h2:	
		li $a0, heart3
		la $a1, heart
		li $a2, 7
		li $a3, 6
		jal reset_special_objects
		li $a0, heart2
		la $a1, heart
		li $a2, 7
		li $a3, 6
		jal draw_object
		j end_heart

draw_h1:	li $a0, heart2
		la $a1, heart
		li $a2, 7
		li $a3, 6
		jal reset_special_objects
		li $a0, heart1
		la $a1, heart
		li $a2, 7
		li $a3, 6
		jal draw_object
		j end_heart
lose:		li $a0, heart1
		la $a1, heart
		li $a2, 7
		li $a3, 6
		jal reset_special_objects		
end_heart:	lw $ra, 0($sp)
		addi $sp, $sp, 4
		jr $ra

game_win:	jal draw_win
		j wait_p


game_over:	jal draw_over
		
		j wait_p



draw_win:	li $t0, BASE_ADDRESS
		lw $t1, row64
		la $t2, w
		
	colour_w:	blt $t0, $t1, continue_w
			jr $ra
	continue_w:	lw $t3, 0($t2)
			sw $t3, 0($t0)
			addi $t0, $t0, 4
			addi $t2, $t2, 4
			j colour_w
	

draw_over:	li $t0, BASE_ADDRESS
		lw $t1, row64
		la $t2, l
		
	colour_l:	blt $t0, $t1, continue_l
			jr $ra
	continue_l:	lw $t3, 0($t2)
			sw $t3, 0($t0)
			addi $t0, $t0, 4
			addi $t2, $t2, 4
			j colour_l

END: li $v0, 10
     syscall
